Since C99, there has been a "snprintf" function which can replace all three of these calls something like this:

  snprintf(outputHdrFileName, FILE_NAME_LENGTH_MAX, "%s.hdr", argv[1]);

or, equivalently, using sizeof  on the array:

  snprintf(outputHdrFileName, sizeof outputHdrFileName, "%s.hdr", argv[1]);

That's it; the result is chopped to fit the buffer, and null terminated. If you want to know whether chopping took place, you can capture the return value. It returns the number of characters that would be written (excluding the null), so if the return value is equal to the buffer size or greater, there was truncation.

E.g. more complicated job:

  if (snprintf(buffer, sizeof buf, "%s/%s/%s.tmp", rootdir, relpath, basename) >= sizeof buffer) {
     // oops handle path-too-long-for-buffer case
  }

